import React from 'react';

class Inventory extends React.Component{
    render(){
        return(
            <div className="inventory">
               <h2>Inventory</h2>
               <form>
                    <input type="text" placeholder="Name" name="name" />
               </form>
            </div>
        );
    }
}

export default Inventory;
